Ottoman Khan I (1258 - 1326) the founder of the Ottoman Empire. He became the leader of his tribe after his father's death, his tribe was attached to the Seljuk's state, and after the fall of the state he called on an independent state and made himself the Sultan of it. He created a well arranged and powerful State, and expanded his state by conquering Byzantine's lands.
Ottoman Khan passed away in 1326.
